hci_enable_le_scan(sock)

def calculate_accuracy(txpower, rssi, selectDevice, selectReceiver):

    rssi = float(rssi)

    if rssi == 0 or txpower == 0:
        return -1

    else:

        if(selectReceiver == "RPI3"):

            if(selectDevice == "Estimote"):

                if rssi > -75.4:
                    return "<1 m"

                else:
                    distance = (6.8070359 * math.pow(10,-6)) * math.pow(rssi,5) + (1.72684109 * math.pow(10,-3)) * math.pow(rssi,4) + (9.68487146 * math.pow(10,-2)) * math.pow(rssi,3) - 8.29703882 * math.pow(rssi,2) - 1045.53627 * rssi - 29372.0844

                    if distance <= 0:
                        return "<1 m"

                    else:
                        return round(distance,2)

            elif(selectDevice == "iNode"):

                if rssi > -65.6:
                    return "<1 m"

                else:
                    distance = (6.77023999 * math.pow(10,-10)) * math.pow(rssi,7) + (1.75901029 * math.pow(10,-7)) * math.pow(rssi,6) + (9.432253 * math.pow(10,-6)) * math.pow(rssi,5) - (8.84246008 * math.pow(10,-4)) * math.pow(rssi,4) - (5.9545811 * math.pow(10,-2)) * math.pow(rssi,3) + 6.4409447 * math.pow(rssi,2) + 646.543015 * rssi + 15242.0714

                    if distance <= 0:
                        return "<1 m"

                    else:
                        return round(distance,2)

            elif(selectDevice == "Ghostyu"):

                if rssi > -68.9:
                    return "<1 m"

                else:
                    distance = (2.24178652 * math.pow(10,-3)) * math.pow(rssi,3) + 0.545257679 * math.pow(rssi,2) + 43.0073617 * rssi + 1109.23485

                    if distance <= 0:
                        return "<1 m"

                    else:
                        return round(distance,2)

            else:
                return " "

        elif (selectReceiver == "RPI4"):

            if(selectDevice == "Estimote"):

                if rssi > -71.1:
                    return "<1 m"

                else:
                    distance = (-9.34450244 * math.pow(10,-14)) * math.pow(rssi,9) - (1.57078285 * math.pow(10,-11)) * math.pow(rssi,8) + (1.86383343 * math.pow(10,-10)) * math.pow(rssi,7) + (8.11246656 * math.pow(10,-8)) * math.pow(rssi,6) - (5.58745763 * math.pow(10,-6)) * math.pow(rssi,5) - (1.9426866 * math.pow(10,-4)) * math.pow(rssi,4) + (5.11923164 * math.pow(10,-2)) * math.pow(rssi,3) - 1.17883372  * math.pow(rssi,2) - 398.525327 * rssi - 12011.859

                    if distance <= 0:
                        return "<1 m"

                    else:
                        return round(distance,2)

            elif(selectDevice == "iNode"):

                if rssi > -64.7:
                    return "<1 m"

                else:
                    distance = (-6.88781342 * math.pow(10,-12)) * math.pow(rssi,8) - (1.41063891 * math.pow(10,-9)) * math.pow(rssi,7) - (2.45471436 * math.pow(10,-8)) * math.pow(rssi,6) + (8.05846717 * math.pow(10,-6)) * math.pow(rssi,5) - (1.12618039 * math.pow(10,-4)) * math.pow(rssi,4) - (4.95059829 * math.pow(10,-2)) * math.pow(rssi,3) + 2.28824668 * math.pow(rssi,2) + 385.339425 * rssi + 10276.6656

                    if distance <= 0:
                        return "<1 m"

                    else:
                        return round(distance,2)

            elif(selectDevice == "Ghostyu"):

                if rssi > -67.7:
                    return "<1 m"

                else:
                    distance = (-8.11274127 * math.pow(10,-12)) * math.pow(rssi,8) - (1.75765976 * math.pow(10,-9)) * math.pow(rssi,7) - (3.83299621* math.pow(10,-8)) * math.pow(rssi,6) + (1.0523531* math.pow(10,-5)) * math.pow(rssi,5) - (9.4328113 * math.pow(10,-5)) * math.pow(rssi,4) - (6.95660555 * math.pow(10,-2)) * math.pow(rssi,3) + 2.9093117 * math.pow(rssi,2) + 562.782068 * rssi + 15942.6933

                    if distance <= 0:
                        return "<1 m"

                    else:
                        return round(distance,2)

            else:
                return " "

        else:
            return " "

class DoCommandThread(QtCore.QThread):

    sgnFinished = pyqtSignal()

    def __init__(self,distanceEdt,listDevice,listReceiver):
        super(QtCore.QThread, self).__init__()
        self._mutex = QMutex()
        self._running = True

        self.distanceEdt = distanceEdt
        self.listDevice = listDevice
        self.listReceiver = listReceiver

    @pyqtSlot()
    def stop(self):
        self._mutex.lock()
        self._running = False
        self._mutex.unlock()

    def running(self):
        try:
            self._mutex.lock()
            return self._running
        finally:
            self._mutex.unlock()

    @pyqtSlot()
    def work(self):

        txpower = 0
        sum = 0
        counter = 0

        while self.running():

            returnedList = parse_rssi(sock)

            for beacon in returnedList:
                rssi = float(beacon.split(",")[1])
                txpower = float(beacon.split(",")[0])
                sum = sum + rssi
                counter = counter + 1

            if(counter > 10):
                averageRSSI = sum/counter
                averageRSSI = round(averageRSSI,2)

                self.distanceEdt.setText(str(calculate_accuracy(txpower, averageRSSI,self.listDevice.currentText(),self.listReceiver.currentText())))

                if self.distanceEdt.text() == "<1 m":
                    producer = self.listDevice.currentText()
                    post_fields = {
                        "t" : "Urządzenie " + producer  + ": "  + MAC_ADDRESS,
                        "m" : "Znajduje się w pokoju nr 202 na 2 piętrze",
                        "s" : 1,
                        "v" : 1,
                        "i" : 123,
                        #w tym miejscu należy podać obraz mapy pomieszczenia przekonwertowany na format DataURL zakodowany w Base64
                        #zakodowanego kodu obrazu mapy w Base64 nie podano w całości z powodu dużej długości
                        "p" : "data:image/png;base64,",
                        #w tym miejscu należy podać klucz prywatny pozyskany z aplikacji PushSafer
                        "k" : "NaCGhjWsIx6DKjIDlGX7"
                        }

                    request = Request(url, urlencode(post_fields).encode())
                    urlopen(request).read().decode()

                counter = 0
                sum = 0

        self.sgnFinished.emit()

