    def start_and_stop(self):

        event = self.sender()

        global MAC_ADDRESS
        MAC_ADDRESS = self.macEdt.text()
        MAC_ADDRESS = MAC_ADDRESS.lower()

        if event.text() == "&Start":

            regex=QtCore.QRegExp("^([0-9A-Fa-f]{2}[:]){5}([0-9A-Fa-f]{2})$")
            validator = QtGui.QRegExpValidator(regex)
            ver = validator.validate(MAC_ADDRESS,0)

            if(ver[0] == 0):
                msg = QMessageBox()
                msg.setIcon(QMessageBox.Warning)
                msg.setText("Podaj adres MAC w formacie XX:XX:XX:XX:XX:XX")
                msg.setWindowTitle("Nieprawidłowy adres MAC")
                msg.exec_()

            elif(ver[0] == 1):
                msg = QMessageBox()
                msg.setIcon(QMessageBox.Warning)
                msg.setText("Adres MAC musi składać się z 12 znaków odzielonych \":\"")
                msg.setWindowTitle("Za krótki adres MAC")
                msg.exec_()

            else:
                self.startBtn.setVisible(False)
                self.pixmap = QPixmap('img/beacon.png')
                self.label.resize(self.pixmap.width(), self.pixmap.height())
                self._thread = QThread()
                self.du = DoCommandThread(self.distanceEdt,self.listDevice,self.listReceiver)
                self.du.moveToThread(self._thread)
                self.du.sgnFinished.connect(self.on_du_done)
                self._thread.started.connect(self.du.work)
                self._thread.start()
                self.startBtn.setEnabled(False)
                self.stopBtn.setEnabled(True)

        elif event.text() == "&Stop":
            self.startBtn.setVisible(True)
            self.pixmap = QPixmap()
            self.label.setPixmap(self.pixmap)

            self.startBtn.setStyleSheet("QPushButton"
                                        "{"
                                        "background-image: url('img/closeDoor.png');"
                                        "font-weight: bold;"
                                        "}"
                                        "QPushButton::hover"
                                        "{"
                                        "background-image: url('img/openDoor.png');"
                                        "}")

            self.distanceEdt.clear()
            self.du.stop()
            self.stopBtn.setEnabled(False)
            self.startBtn.setEnabled(True)

        else:
            pass

    @pyqtSlot()
    def on_du_done(self):
        self._thread.quit()
        self._thread.wait()

